import React, { createContext, useState } from "react";

const mycontext=createContext()
const [data,setdata]=useState(true)
const myprovider = ({children})=>{
 
 return (
    <mycontext.Provider value={{data,setdata}}>
        {children}
    </mycontext.Provider>
 )
}

export default myprovider;
